import React from "react";
import Common from "./Common";

const About = () => {
  return (
    <>
      <Common
        name="Welcome to About page"
        visit="/contact"
        imgsrc="https://bootstrapmade.com/demo/templates/Arsha/assets/img/hero-img.png"
        btname="Contact Now"
      />
    </>
  );
};

export default About;
